class Solution:
    def maxProduct(self, n: int) -> int:
        l = []
        while n:
            l.append(n % 10)
            n = n//10
        l.sort()
        return l[-1] * l[-2]

class Solution:
    def maxProduct(self, n: int) -> int:
        s = str(n)
        arr = sorted(int(_) for _ in s)
        return arr[-1] * arr[-2]

class Solution:
    def maxProduct(self, n: int) -> int:
